class ServQuantHeader extends Component {




  render() {

    return (

        <th className="servingH tooltip">
        <i class="fas fa-coins"></i><span className = "tooltiptext primaryFont black">Serving Quantity</span>
      </th>
    )
}
}

export default ServQuantHeader
